import NavBar from './components/NavBar'
import Banner from './components/Banner'
import Skills from './components/Skills'
import Works from './components/Works'
import Footer from './components/Footer'
import './App.css';

function App() {
  return (
    <>
      <NavBar />
      <Banner />
      <Skills />
      <Works />
      <Footer />
    </>
  );
}

export default App;
